class CHOOSE_PLACE():
    step_name = 'CHOOSE_PLACE'

    def __init__(self):
        print(f'Registering {self.step_name} step')

    def predict(self,img,place1,place2):
        prompt1 = f'Tell me what the {place1} looks like in one sentence.'
        prompt2 = f'Tell me what the {place2} looks like in one sentence.'
        place_desc1 = API.gpt3(prompt1, 'gpt3_general')
        place_desc2 = API.gpt3(prompt2, 'gpt3_general')
        result1 = API.clip(img,place_desc1)
        result2 = API.clip(img,place_desc2)
        if result1 > result2:
            result = place1
        else:
            result = place2
        return result

    def execute(self,img,place1,place2):
        result = self.predict(img,place1,place2)
        return result
